oD("common/io/network.effekt",'module io/network\n\nimport bytearray\nimport io\n\nnamespace js {\n  extern jsNode !!!MULTILINEMARKER!!!\n    const net \x3d require(\'node:net\');\n\n    function listen(server, port, host, listener) {\n      server.listen(port, host);\n      server.on(\'connection\', listener);\n    }\n  !!!MULTILINEMARKER!!!\n\n  extern type JSServer // \x3d net.Server\n  extern type JSSocket // \x3d net.Socket\n  extern io def server(): JSServer \x3d\n    jsNode "net.createServer()"\n  extern io def listen(server: JSServer, port: Int, host: String, listener: JSSocket \x3d\x3e Unit at {io, async, global}): Unit \x3d\n    jsNode "listen(${server}, ${port}, ${host}, (socket) \x3d\x3e $effekt.runToplevel((ks, k) \x3d\x3e (${listener})(socket, ks, k)))"\n\n  extern async def send(socket: JSSocket, data: ByteArray): Unit \x3d\n    jsNode "$effekt.capture(callback \x3d\x3e ${socket}.write(${data}, callback))"\n\n  extern async def receive(socket: JSSocket): ByteArray \x3d\n    jsNode "$effekt.capture(callback \x3d\x3e ${socket}.once(\'data\', callback))"\n\n  extern async def end(socket: JSSocket): Unit \x3d\n    jsNode "$effekt.capture(k \x3d\x3e ${socket}.end(k))"\n}\n\ninterface Socket {\n  def send(message: ByteArray): Unit\n  def receive(): ByteArray\n  def end(): Unit\n}\n\ndef server(host: String, port: Int, handler: () \x3d\x3e Unit / Socket at {io, async, global}): Unit \x3d {\n  val server \x3d js::server();\n  js::listen(server, port, host, box { socket \x3d\x3e\n    println("New connection")\n    spawn(box {\n      try handler()\n      with Socket {\n        def send(message) \x3d\n          resume(js::send(socket, message))\n        def receive() \x3d\n          resume(js::receive(socket))\n        def end() \x3d\n          resume(js::end(socket))\n      }\n    })\n  })\n}\n\n\nnamespace examples {\n  def helloWorldApp(): Unit / Socket \x3d {\n    val request \x3d do receive().toString;\n\n    println("Received a request: " ++ request)\n\n    def respond(s: String): Unit / Socket \x3d\n      do send(s.fromString)\n\n    if (request.startsWith("GET /")) {\n      respond("HTTP/1.1 200 OK\\r\\n\\r\\nHello from Effekt!")\n    } else {\n      respond("HTTP/1.1 400 Bad Request\\r\\n\\r\\n")\n    }\n    do end()\n  }\n\n  // A server that just shows "Hello from Effekt!" on localhost:8080\n  def main() \x3d {\n    val port \x3d 8080\n    println("Starting server on http://localhost:" ++ port.show)\n\n    server("localhost", port, box {\n      helloWorldApp()\n    })\n  }\n}\n');
